-- ----------------------------
-- Procedure structure for acFullName
-- ----------------------------
DROP PROCEDURE [dbo].[acFullName]
GO





CREATE proc [dbo].[acFullName]
	@FullName varchar(200) = null
as

while CharIndex('  ', @FullName) > 0
begin
	set @FullName = REPLACE(@FullName,'  ',' ') 
end


select top 20 UserID,FirstName,LastName from Users  
Where (FirstName + ' ' + LastName like '%'+@FullName+'%')



GO

-- ----------------------------
-- Procedure structure for EnquiryAccessDetail
-- ----------------------------
DROP PROCEDURE [dbo].[EnquiryAccessDetail]
GO


CREATE proc [dbo].[EnquiryAccessDetail]
@AccessLevelID int = null
, @PageID int = null
, @PageUrl varchar(500) = null
as

select distinct ad.* 
from AccessDetail ad
		inner join Page p on ad.PageID = p.PageID 
where	(ad.AccessLevelID = @AccessLevelID or @AccessLevelID is null)
		and (ad.PageID = @PageID or @PageID is null)
		and (p.PageUrl = @PageUrl or @PageUrl is null)



GO

