GO


CREATE proc [dbo].[EnquiryUser]
@UserID int = null
, @UserName varchar(100) = null
, @Name varchar(200) = null
, @Email varchar(100) = null
, @ProvinceID int = null
, @PositionID int = null
, @OfficeID int = null
, @AccessLevelID int = null
, @UserStatusID int = null
, @KeyPassword varchar(100) = null
as

select	u.*, us.UserStatusName, al.AccessLevelName, dt.DistrictName, pv.ProvinceName
		, tm.TambonName, Po.PositionName
		, officeName
from	Users u
		inner join UserStatus us on u.UserStatusID = us.UserStatusID 
		inner join AccessLevel al on u.AccessLevelID = al.AccessLevelID 
		inner join District dt on u.DistrictID = dt.DistrictID 
		inner join Province pv on u.ProvinceID = pv.ProvinceID 
		inner join office oce on u.officeID = oce.OfficeID
		left outer join Tambon tm on u.TambonID = tm.TambonID 
		left outer join Position Po on u.PositionID = Po.PositionID 
Where (UserID = @UserID or @UserID is null)
		and (UserName like @UserName+'%' or @UserName is null)
		and ((u.FirstName like '%'+@Name+'%' or u.LastName like '%'+@Name+'%') or @Name is null)
		and (u.Email like @Email+'%' or @Email is null)
		and (u.ProvinceID = @ProvinceID or @ProvinceID is null)
		and (u.PositionID = @PositionID or @PositionID is null)
		and (u.OfficeID = @OfficeID or @OfficeID is null)
		and (u.AccessLevelID = @AccessLevelID or @AccessLevelID is null)
		and (u.UserStatusID = @UserStatusID or @UserStatusID is null)
		and (u.KeyPassword = @KeyPassword or @KeyPassword is null)


GO

