CREATE proc [dbo].[GetAccessDetail]
@AccessLevelID int = null
, @PageID int = null
as
Declare @IsAccess bit

if exists(select ad.AccessDetailID  
from AccessDetail ad
		inner join Page p on ad.PageID = p.PageID 
where	(ad.AccessLevelID = @AccessLevelID or @AccessLevelID is null)
		and (ad.PageID = @PageID or @PageID is null)
)
	set @IsAccess = 1
else
	set @IsAccess = 0

select @IsAccess as IsAccess



GO

