-- ----------------------------
DROP PROCEDURE [dbo].[GetAllVisitorAmount]
GO




CREATE Proc [dbo].[GetAllVisitorAmount]
as
declare @Members int
declare @Visitor int

declare @LastMonth datetime
set @LastMonth = DateAdd(month,-1,getdate())

if not exists(select [Year] From HitLogVisitor where [YEAR] = YEAR(@LastMonth) and [Month] = MONTH(@LastMonth))
begin
	exec ReCalulateHitlogPerMonth
end

select	@Visitor = Count(Distinct SessionID)
from		hitlog h with(Index=IX_Hitlog)
Where	(HitDate Between convert(varchar(7), Getdate(), 120) + '-01' and GETDATE())
			and (UserID not in(select UserID From sm..Users Where AccessLevelID = 1) or UserID is null)
select	@Members = Count(Distinct UserID)
from		hitlog h with(Index=IX_Hitlog)
Where	(HitDate Between convert(varchar(7), Getdate(), 120) + '-01' and GETDATE())
			and (UserID not in(select UserID From sm..Users Where AccessLevelID = 1) and UserID is not null)

select SUM(Visitor) + @Visitor + @Members From HitlogVisitor as Amount



GO

