-- ----------------------------
-- Procedure structure for Login
-- ----------------------------
DROP PROCEDURE [dbo].[Login]
GO
-- =============================================
-- Author:		<Author,,Name>
-- Create date: <Create Date,,>
-- Description:	<Description,,>
-- =============================================
CREATE PROCEDURE [dbo].[Login]
	@UserName nvarchar(20)
	, @Password nvarchar(200)
	, @MaxAttempt int = 0
	, @DayForce int = 0
	, @DayLock int = 0
	, @DayDeactive int = 0
as
--Example: exec Login 'xxxxxx', 'xxxxxx', 3, 30,60,90
set nocount on

set @UserName = ltrim(rtrim(@UserName))
set @Password = ltrim(rtrim(@Password))
set @MaxAttempt = isnull(@MaxAttempt,0)
set @DayForce = isnull(@DayForce,0)
set @DayLock = isnull(@DayLock,0)
set @DayDeactive = isnull(@DayDeactive,0)


Declare @UserID int, @sPassword nvarchar(100), @LoginAttempt int, @LastUpdate datetime, @UserStatus nvarchar(50), @LastLogin datetime

select	@UserID = UserID, @sPassword = Password, @LoginAttempt = isnull(LoginAttempt,0)
			, @LastUpdate = LastUpdate, @UserStatus = us.UserStatusName, @LastLogin = LastLogin
from		users u
			inner join UserStatus us on u.UserStatusID = us.UserStatusID
where	UserName = @UserName 
			and (ExpireDate is null or ExpireDate >= getdate())

if @userID is null
begin
	select null as UserID , null as FirstName, null as LastName, null as ACLID, null as ACLName, null as LoginAttempt, null as LastLogin, 'Login Failed' as Comment
	return
end

if lower(@UserStatus) <> 'active'-- and lower(@UserStatus) <> 'waiting approve'
begin
	select null as UserID , null as FirstName, null as LastName, null as ACLID, null as ACLName, null as LoginAttempt, null as LastLogin, 'UserID is ' + @UserStatus as Comment
	return
end

if DateDiff(day,@LastLogin, getdate()) > @DayDeactive and @DayDeactive > 0
begin
	update users 
	set		UserStatusID = (select Top 1 UserStatusID from UserStatus where lower(UserStatusName)='deactive')
	where	UserID = @UserID
	select null as UserID , null as FirstName, null as LastName, null as ACLID, null as ACLName, null as LoginAttempt, null as LastLogin, 'UserID is Deactived' + @UserStatus as Comment
	return
end

if DateDiff(day,@LastLogin, getdate()) > @DayLock and @DayLock > 0
begin
	update users 
	set		UserStatusID = (select Top 1 UserStatusID from UserStatus where lower(UserStatusName)='lock')
	where	UserID = @UserID
	select null as UserID , null as FirstName, null as LastName, null as ACLID, null as ACLName, null as LoginAttempt, null as LastLogin, 'UserID is Locked' + @UserStatus as Comment
	return

end

if @Password <> @sPassword
begin
	set @LoginAttempt = @LoginAttempt + 1
	update users 
	set		LoginAttempt = @LoginAttempt
				,LastLogin = getdate()
	where	UserID = @UserID

	if @LoginAttempt = @MaxAttempt and @MaxAttempt > 0
	begin
		update users 
		set		UserStatusID = (select Top 1 UserStatusID from UserStatus where lower(UserStatusName)='lock')
					,LastUpdate = getdate()
		where	UserID = @UserID
		select null as UserID , null as FirstName, null as LastName, null as ACLID, null as ACLName, null as LoginAttempt, null as LastLogin, 'UserID is Locked' as Comment
		return
	end

	select null as UserID , null as FirstName, null as LastName, null as ACLID, null as ACLName, null as LoginAttempt, null as LastLogin, 'Login Failed' as Comment
	return
end

if datediff(day, @LastUpdate, getdate()) > @DayForce and @DayForce > 0
begin
	select null as UserID , null as FirstName, null as LastName, null as ACLID, null as ACLName, null as LoginAttempt, null as LastLogin, 'Force Change Password' as Comment
	return
end

update users 
set		LoginAttempt = 0
			,LastLogin = getdate()
where	UserID = @UserID

select u.UserID, u.FirstName, u.LastName, al.AccessLevelID, al.AccessLevelName, @LoginAttempt as LoginAttempt, u.LastLogin, 'Login Success' as Comment
from		users u
			inner join AccessLevel al on u.AccessLevelID = al.AccessLevelID 
where	UserID = @UserID
			and (ExpireDate is null or ExpireDate >= getdate())
			and UserStatusID in(1,5)



GO

-- ----------------------------
-- Procedure structure for ReCalulateHitlogPerMonth
-- ----------------------------
DROP PROCEDURE [dbo].[ReCalulateHitlogPerMonth]
GO




CREATE proc [dbo].[ReCalulateHitlogPerMonth]
as
declare @bDate datetime
declare @eDate datetime	
declare @Members int
declare @Visitor int

	
	set @eDate = CONVERT(datetime,convert(varchar(10), DateAdd(DAY,-1,convert(datetime,convert(varchar(7),getdate(),120)+'-01')), 120) + ' 23:59:59')
	set @bDate = Convert(datetime ,Convert(varchar(7),@eDate, 120)+'-01')
	
	select	@Visitor = Count(Distinct SessionID)
	from		hitlog h with(Index=IX_Hitlog)
	Where	(HitDate Between @bDate and @eDate)
				and (UserID not in(select UserID From sm..Users Where AccessLevelID  = 1) or UserID is null)
	select	@Members = Count(Distinct UserID)
	from		hitlog h with(Index=IX_Hitlog)
	Where	(HitDate Between @bDate and @eDate)
				and (UserID not in(select UserID From sm..Users Where AccessLevelID  = 1) and UserID is not null)

	insert into HitlogVisitor([Year],[Month],Visitor) values(Year(@bDate), Month(@bDate), @Visitor + @Members)	



GO

